settings.colorFunction:
let color;

if(dsData[dsIndex]['humidity_status'] === "critical" || dsData[dsIndex]['temp_status'] === "critical") {
    color = "red";
} else if(dsData[dsIndex]['humidity_status'] === "warning" || dsData[dsIndex]['temp_status'] === "warning") {
    color = "orange";
} else if(dsData[dsIndex]['humidity_status'] === "ok" ||dsData[dsIndex]['temp_status'] === "ok") {
    color = "green";
} else {
    color = "silver";
}

return color;

settings.markerImageFunction:
var type = dsData[dsIndex]['type'];
if (type == 'thermomether') {
	var res = {
	    url: images[0],
	    size: 40
	}
	var temperature = dsData[dsIndex]['temperature'];
	if (typeof temperature !== undefined) {
	    var percent = (temperature + 60)/120;
	    var index = Math.min(3, Math.floor(4 * percent));
	    res.url = images[index];
	}
	return res;
}

settings.labelFunction:
var deviceType = dsData[dsIndex]['deviceType'];
if (typeof deviceType !== undefined) {
    if (deviceType == "energy meter") {
        return '<span style="color:orange;">${entityName}, ${energy:2} kWt</span>';
    } else if (deviceType == "thermometer") {
        return '<span style="color:blue;">${entityName}, ${temperature:2} °C</span>';
    }
}

settings.tooltipFunction:
let temp, humidity;

temp = dsData[dsIndex]['temp'];
if(temp === null) {
    temp = "not set";
} else {
    temp = temp + '°C';
}

humidity = dsData[dsIndex]['humidity'];
if(humidity === null) {
    humidity = "not set";
} else {
    humidity = humidity + '%';
}


return `<b>\${entityLabel}</b><br /><br /><b>Humidity:</b> ${humidity}<br/><b>Temperature:</b> ${temp}<br/><small>See advanced settings for details</small>`;

